import React from "react";
import { Nav } from 'react-bootstrap';

class Navbar extends React.Component {
  render() {
    return (
      <React.Fragment>
        <Nav variant="tabs" defaultActiveKey="/home" className="justify-content-center h4 p-4">
          <Nav.Item>
            <Nav.Link href="/home">Active</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-1">Estudios</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-1">Skills</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-1">Proyectos</Nav.Link>
          </Nav.Item>
        </Nav>
      </React.Fragment>
    );
  }
}

export default Navbar;
